cim:FunctionDescriptor.cim:FunctionDescriptor.equation:
model Voltage_Unbalance_Control_Gain_4

equation
	yo = Selfix(Balanced(), 0.0, K*yi);

end Voltage_Unbalance_Control_Gain_4;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function Balanced
	parameter Integer domainType (start=1);
	output Boolean yo;
algorithm
	domainType = 1; // 1 for balanced RMS, 2 for unbalanced RMS, 3 for EMT simulation
	if domainType = 1 then
		yo = True;
	else
		yo = False;
	end if;
end Balanced;

model Voltage_Unbalance_Control_First_order_lag_block

equation
	// First order lag block with time constant T
	der(x)=Selfix(Balanced(), 0.0, ((yi-x)/max(0.000001,T)));
	yo=Selfix(Balanced(), 0.0, x);

end Voltage_Unbalance_Control_First_order_lag_block;

