model Voltage_Unbalance_Control_PI_controller

equation
	freeze_xi = Flipflop(block or FRT or i2Q_in_limit, (not block) and (not i2Q_in_limit) and (not FRT));
	der(xi)  = Selfix(Balanced(), 0.0, Select(freeze_xi, 0.0, Ki*yin));
	yout = Selfix(Balanced(), 0.0, PIcontrol(xi,-ymax,ymax,Kp*yin));

end Voltage_Unbalance_Control_PI_controller;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
