	end if;
end Balanced;

function Flipflop
	input  Boolean boolset;
	input  Boolean boolreset;
	output Boolean state;
algorithm
	if (boolset = true) and (boolreset = false) then
		state := true;
	end if;
	if (boolset = false) and (boolreset = true) then
		state := false;
	end if;	
end Flipflop;

function PIcontrol
	input Real state;
	input Real min;
	input Real max;
	input Real prop_input;
	output Real yo;
algorithm
	if (prop_input + state < min) then
		yo = min;
	end if;
	else if (prop_input + state > max) then
		yo = max;
	else
		yo = prop_input + state;
	end if;	
end PIcontrol;

