Real i2P_ref;
    if noEvent(abs(i2P_ref))) < 1e-6 then
    i2P_ref = 0;
end if;
Real i2Q_ref;
    if noEvent(abs(i2Q_ref))) < 1e-6 then
    i2Q_ref = 0;
end if;
Real u2d;
    if noEvent(abs(u2d))) < 1e-6 then
    u2d = 0;
end if;
Real u2q;
    if noEvent(abs(u2q))) < 1e-6 then
    u2q = 0;
end if;
Boolean block;
    if noEvent(abs(block))) < 1e-6 then
    block = 0;
end if;
Boolean FRT;
    if noEvent(abs(FRT))) < 1e-6 then
    FRT = 0;
end if;
Boolean i2Q_in_limit;
    if noEvent(abs(i2Q_in_limit))) < 1e-6 then
    i2Q_in_limit = 0;
end if;
Real xi (start =  i2Q_ref);
Real xdroop (start =  X2*i2Q_ref);
Real u2d_ref (start = Selfix(Balanced(), 0.0, Selfix(Mode>1.5, u2d+X2*i2Q_ref, Selfix(Mode>0.5, Selfix(abs(B2)>0.000001, u2d + i2Q_ref/B2,    Selfix(abs(G2)>0.000001, u2d + i2P_ref/G2, 0.0)), 0.0))));
Real u2q_ref (start = Selfix(Balanced(), 0.0, u2q));

